function [M, a] = daubechiesmatrix(varargin)
% [ M, a ]= daubechiesmatrixrix( N , [options] )   
% Constructs the set of two matrices whose joint spectral radius is closely related to the Hoelder-exponent of Daubechies' wavelets.
%
% Input:
%   N       N>=2, index of Daubechies wavelet. N=1 would correspdond to the Haar-wavelet.
%
% Options:
%   'jung'      (default) Uses the algorithm by R. Jungers. 
%   'gugl'      Uses the algorithm by N. Guglielmi. 
%   'double'    returns double values
%   'verbose'   verbose level
%
% Output:
%   M       set of two matrices whose joint spectral radius is closely related to the Hoelder exponent of continuity of Daubechies' wavelets
%           is empty for N=1
%   a       the subdivision mask generating the daubechies wavelet
%
% Note:
%   For values N>=43 the returned matrices from algorithm 'jung' and 'gugl' differ very much.
%       Wich algorithm is better is not investigated yet.
%       Algorithm 'jung' seems to be numerically more stable, but this is just a heurisitic observation.
%   For N==1 the function returns {[1]}, which is NOT the mask of a Daubechies wavelet.
%   
%
% E.g.: vdisp(daubechiesmatrixrix(1))
%
% Reference:
%  [1] I. Daubechies and J.C. Lagarias
%        "Two-scale difference equations II. local regularity, infinite
%        products of matrices and fractals",
%      SIAM J. on Math. Anal., 23(4):1031-1079, 1992
%
%  [2] G. Gripenberg, 
%        "Computing the joint spectral radius", 
%      Linear Algebra and its Applications, 234:43-60, 1996
%
%  [3] R. Jungers, 
%        "The Joint Spectral Radius: Theory and Applications" 
%      Vol. 385 section 2.3.3 in Lecture Notes in Control and Information
%      Sciences, Springer-Verlag. Berlin Heidelberg, June 2009
%
% Written by: JSR-Toolbox, Jungers
% Modified by: tommsch, 2018

[guglflag,varargin]=parsem('gugl',varargin);
[doubleflag,varargin]=parsem({'double','d'},varargin);
[verbose,varargin]=parsem({'verbose','v'},varargin,1);

if(guglflag)
    [M, a]=daubechiesmatrix_gugl(varargin{1},verbose);
else
    [M, a]=daubechiesmatrix_jung(varargin{1},verbose);
end

if(doubleflag)
    M{1}=double(M{1});
    M{2}=double(M{2});
    a=double(a);
end

end

function [M, a] = daubechiesmatrix_gugl(n,verbose);

digitsold=digits;
newdigits=max(30,n*6);
vprintf('Computing with vpa. Number of digits: %i\n', newdigits,'imp',[1 verbose]);
digits(max(30,n*6));

try
    a=daubechiesmask(n).'; %this is the numbering for the Daubechies wavelets from Guglielmi and Protasov
catch
    a=daubechiesmask_backup(n).'; %this is the numbering for the Daubechies wavelets from Guglielmi and Protasov
end

d=sym(zeros(n+1,1));
for j=1:n+1 
    d(j)=nchoosek(sym(n),j-1);
end

[Qsym,Rsym]=quorem(mask2symbol(a),mask2symbol(d));
ERROR=norm(symbol2mask(Rsym));
Q=symbol2mask(Qsym,'sym');

vprintf('Error of deconvolution: %i\n', ERROR,'imp',[1 verbose]);

T0=zeros(n-1);
T1=zeros(n-1);
for i=1:n-1
    for j=1:n-1
        idx0=2*i-j;
        idx1=2*i-j+1;
        if(idx0>=1 && idx0<=n)
            T0(i,j)=Q(idx0);
        end

        if(idx1>=1 && idx1<=n)
            T1(i,j)=Q(idx1);
        end
    end
end 
M={T0 T1};

digits(digitsold);

end


function [M, a] = daubechiesmatrix_jung(n,verbose)

digitsold=digits;
try
    a=daubechiesmask(n).'; 
catch
    a=daubechiesmask_backup(n).';
end

newdigits=max(30,n*6);
vprintf('Computing with vpa. Number of digits: %i\n', newdigits,'imp',[1 verbose]);
digits(max(30,n*6));
T=sym(zeros(n,n,2));

n=2*n-1; %this is the number the algorithm needs
vprintf('Computing transition matrices.\n','imp',[1 verbose]);
for i=1:n
    for j=1:n
        if (((2*i-j-1)>=0)&&((2*i-j-1)<=n))
            T(i,j,1)=a(2*i-j);
        end
        if (((2*i-j)>=0)&&((2*i-j)<=n))
            T(i,j,2)=a(2*i-j+1);
        end
    end
end

vprintf('Computing difference operator.\n','imp',[1 verbose]);
%L=(N+1)/2-1; %Original
L=(n+1)/2-2; %Original

U=sym(zeros(n,L+1));
for j=1:L+1
    for i=1:n
        U(i,j)=i^sym(j-1);
    end
end

[q,~]=qr(U);
projecteur=q(:,L+2:n)' ;
vprintf('Condition number for difference operator: %g\n', cond(U),'imp',[1 verbose]);

vprintf('Computing transition matrices of difference scheme.\n','imp',[1 verbose]);
Tproj(:,:,1)=projecteur*T(:,:,1)*projecteur';
Tproj(:,:,2)=projecteur*T(:,:,2)*projecteur';

M = [{Tproj(:,:,1)}, {Tproj(:,:,2)}];

digits(digitsold);

end

